import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useWindow } from "../contexts/window-context";

export function logo() {
    const window = useWindow()
    let name = window.appName
    let version = window.appVersion

    return <Box display='flex'>
        <Box>
            <img width='120px' height='120px' src='data:image/png;base64,' />
        </Box>
        <Box marginLeft='24px'>
            <Typography variant='h1' fontSize='48px'>{name}</Typography>
            <Typography variant='h2' fontSize='18px'>{version}</Typography>
        </Box>

    </Box>

}